import React, { useState } from "react";
import List from "./components/List";

function App() {
  const todos = [
    { id: 1, compelted: false, title: "Look to the next action" },
    {id: 2,compelted: false,
      title: "Make done previous and this items",
    },
    {
      id: 3,
      compelted: false,
      title: "to be proud of yourself",
    },
  ];
  return (
    <div className="wrapper">
      <h1>2DoList</h1>
      <List></List>
    </div>
  );
}

export default App;
